import React from "react";
// import {} from 'react-icons/ai'

export const PostItem = ({post}) => {
    return <div>
        <div className="post-item">
            <h3>{ post.model }</h3>
            <p>{ post.urlOff }</p>
            <p>{ post.urlBook }</p>
            <p>URL img</p>
            <p>{ post.info }</p>
        </div>
        </div>

}
